import React from "react";

function Movie({name, picture}){

    //console.log(props.released);
    return <div>
               <h1>Movie {name}</h1>
               <img src={picture} alt={name}></img>

           </div>
}

const myBestMovie = [
    {
        id: 1,
        name: "a",
        image: "data:image/jpeg;base64,",

    },
    {
        id: 2,
        name: "b",
        image: "data:image/jpeg;base64,"

    },
]

function App() {
    return (
        <div>
            <h1>Hello React!</h1>
            {myBestMovie.map(movie => (
            <Movie key={movie.id} name = {movie.name} picture = {movie.image}/>
            ))}
            
        </div>
    );  
}

export default App;